    function _mint(address account, uint256 amount) internal virtual override {
        require(ERC20Upgradeable.totalSupply() + amount <= MAXSUPPLY, "ERC20Capped: cap exceeded");
        super._mint(account, amount);
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        require(!(hasRole(DEFAULT_ADMIN_ROLE, msg.sender) && amount >= MAXSUPPLY), "Use the submit transaction function");
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function transferRequest(address sender, address recipient, uint256 amount) public virtual returns (bool) {
        require(!(hasRole(DEFAULT_ADMIN_ROLE, msg.sender) && amount >= MAXSUPPLY), "Use the submit transaction function");
        _transfer(sender, recipient, amount);
        return true;
    }

    function setRole(address _newAdmin) public onlyAdmin virtual {
        _setupRole(DEFAULT_ADMIN_ROLE, _newAdmin);
        _setupRole(MINTER_ROLE, _newAdmin);
        _setupRole(PAUSER_ROLE, _newAdmin);
    }

    function removeRole(address _oldAdmin) public onlyAdmin virtual {
        _revokeRole(DEFAULT_ADMIN_ROLE, _oldAdmin);
        _revokeRole(MINTER_ROLE, _oldAdmin);
        _revokeRole(PAUSER_ROLE, _oldAdmin);
    }

    function setRequestSCAddress(address _requestSCAddress) public onlyAdmin virtual {
        _setupRole(DEFAULT_ADMIN_ROLE, _requestSCAddress);
        _setupRole(MINTER_ROLE, _requestSCAddress);
        _setupRole(PAUSER_ROLE, _requestSCAddress);
    }
    
